import {createTheme} from "@mui/material";
import "./theme.css"
const theme= createTheme({
    typography:{
        h1:{
            fontFamily: "Ultra",
            fontSize: "3",
            color: "#EF7B45",
        },
        h2: {
            fontFamily: "Ultra",
            fontSize: "1.5",
        }
    }
})

export default theme
